import React from 'react';
import { Layout, Space } from 'antd';
const { Footer, Sider, Content } = Layout;
import AppHeader from './Components/Header';


const App = () => (
    <Layout>
      <AppHeader/>
      <Content>Content</Content>
      <Footer>Footer</Footer>
    </Layout>
);

export default App;
